/* Background scrolling animation */
.background {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-image: url(/GFX/stonwall.png);
    background-size: auto;
    background-repeat: repeat;
    animation: scrollBackground 7s linear infinite;
    z-index: -1;
}

@keyframes scrollBackground {
    from {
        background-position: 0 0;
    }
    to {
        background-position: 24px 24px;
    }
}

/* Class to apply the panning animation to any element with the specific background */
.panning-background {
    background-image: url(/GFX/stonwall.png);
    background-size: auto;
    background-repeat: repeat;
    animation: scrollBackground 7s linear infinite;
}

#selection sort
def selectionSort(arr):
    for i in range(len(arr)):
        min_index = i
        for j in range(i+1,len(arr)):
            if arr[min_index] > arr[j]:
                min_index = j
        arr[i],arr[min_index] = arr[min_index],arr[i]
    print(arr)
selectionSort([9,8,7,6,5,4,3,2,1])

#Bubble sort
def bubbleSort(custom_list):
    for i in range(len(custom_list)-1):
        for j in range(len(custom_list)-i-1):
            if custom_list[j]> custom_list[j+1]:
                custom_list[j],custom_list[j+1] = custom_list[j+1],custom_list[j]
    print(custom_list)
clist = [2,1,4,6,2,8,5,4,6,12]
bubbleSort(clist)

using System;
using System.Collections.Generic;

namespace CSLight
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Zoo zoo = new Zoo();
            zoo.ShowAnimals();
        }
    }

    class Zoo
    {
        private List<Aviary> _aviaries;
        private List<Animal> _animalTypes;

        public Zoo()
        {
            InitAnimalTypes();
            InitAviaries();
        }

        public void ShowAnimals()
        {
            const string CommandExit = "exit";

            bool isRunnig = true;

            while (isRunnig)
            {
                Console.WriteLine($"–í –∑–æ–æ–ø–∞—Ä–∫–µ {_aviaries.Count} –≤–æ–ª—å–µ—Ä–∞. –ö –∫–∞–∫–æ–º—É –ø–æ–¥–æ–π—Ç–∏?");

                string userInput = Console.ReadLine();

                if (int.TryParse(userInput, out int result))
                {
                    if (result >= 0 && result < _aviaries.Count)
                    {
                        _aviaries[result].ShowInfo();
                    }
                    else
                    {
                        Console.WriteLine("–¢–∞–∫–æ–≥–æ –≤–æ–ª—å–µ—Ä–∞ –Ω–µ—Ç");
                    }
                }
                else if (userInput == CommandExit)
                {
                    isRunnig = false;
                }

                Console.ReadKey();
            }
        }

        private void InitAnimalTypes()
        {
            _animalTypes = new List<Animal>();
            _animalTypes.Add(new Dog().Clone());
        }

        private void InitAviaries()
        {
            _aviaries = new List<Aviary>();
            string description = "–í–æ–ª—å–µ—Ä " + _aviaries.Count;

            _aviaries.Add(new Aviary(description, new Dog()));
            description = "–í–æ–ª—å–µ—Ä " + _aviaries.Count;

            _aviaries.Add(new Aviary(description, new Bird()));
            description = "–í–æ–ª—å–µ—Ä " + _aviaries.Count;

            _aviaries.Add(new Aviary(description, new Cat()));
            description = "–í–æ–ª—å–µ—Ä " + _aviaries.Count;

            _aviaries.Add(new Aviary(description, new Cow()));
            description = "–í–æ–ª—å–µ—Ä " + _aviaries.Count;
        }
    }

    class Aviary
    {
        private List<Animal> _animals;
        private int _capacity;

        public Aviary(string description, Animal animal)
        {
            _capacity = 10;
            Description = description;

            InitAnimals(animal);
        }

        public string Description { get; private set; }

        public Animal AnimalType { get; private set; }

        public int AnimalsCount
        {
            get { return _animals.Count; }
        }

        public void ShowInfo()
        {
            Console.WriteLine(Description);

            foreach (Animal animal in _animals)
            {
                Console.WriteLine($"{animal.Type} - {animal.Gender} - {animal.Sound}");
            }
        }

        private void InitAnimals(Animal animal)
        {
            _animals = new List<Animal>();

            for (int i = 0; i < _capacity; i++)
            {
                _animals.Add(animal.Clone());
            }
        }
    }

    class Animal
    {
        public Animal()
        {
            SelectRandomGender();
        }

        public string Type { get; protected set; }

        public Genders Gender { get; protected set; }

        public string Sound { get; protected set; }

        public virtual Animal Clone()
        {
            return new Animal();
        }

        private void SelectRandomGender()
        {
            int gendersCount = Enum.GetNames(typeof(Genders)).Length;
            int genderId = UserUtils.GenerateRandomNumber(gendersCount);

            Gender = (Genders)genderId;
        }
    }

    class Dog : Animal
    {
        public Dog() : base()
        {
            Type = "–°–æ–±–∞–∫–∞";
            Sound = "–ì–∞–≤";
        }

        public override Animal Clone()
        {
            return new Dog();
        }
    }

    class Cat : Animal
    {
        public Cat() : base()
        {
            Type = "–ö–æ—Ç";
            Sound = "–ú—è—É";
        }

        public override Animal Clone()
        {
            return new Cat();
        }
    }

    class Bird : Animal
    {
        public Bird() : base()
        {
            Type = "–ü—Ç–∏—Ü–∞";
            Sound = "–ß–∏—Ä–∏–∫";
        }

        public override Animal Clone()
        {
            return new Bird();
        }
    }

    class Cow : Animal
    {
        public Cow() : base()
        {
            Type = "–ö–æ—Ä–æ–≤–∞";
            Sound = "–ú—É";
        }

        public override Animal Clone()
        {
            return new Cow();
        }
    }

    enum Genders
    {
        Male,
        Female
    }

    class UserUtils
    {
        private static Random s_random = new Random();

        public static int GenerateRandomNumber(int maxValue)
        {
            return s_random.Next(maxValue);
        }
    }
}
